import { Link } from "react-router-dom";
import { useHistory  } from "react-router-dom";

import { Layout, Menu } from 'antd';
import { UserOutlined, LaptopOutlined, NotificationOutlined } from '@ant-design/icons';




const TopBar = () => {

  let history = useHistory();

  const onHome = () =>{
    history.push("/");


  };

  const onLogin = ()=>{
    history.push("/login");

  };

  const onSignUp =()=>{
      history.push("/signup");
  };


  const { SubMenu } = Menu;
  const { Header, Content, Footer, Sider } = Layout;

  return(
    <Layout>
      <Header className="header">
        <div className="logo" />
        <Menu theme="dark" mode="horizontal" style={{padding:"0 1000px"}} defaultSelectedKeys={['2']}>
          <Menu.Item key="1" onClick ={onHome}> Home</Menu.Item>
          <Menu.Item key="2" onClick ={onLogin}>Login</Menu.Item>
          <Menu.Item key="3" onClick ={onSignUp}>SignUp</Menu.Item>
        </Menu>

      </Header>
      <Content style={{ padding: '0 50px' }}>
        <Layout className="site-layout-background" style={{ padding: '24px 0' }}>
          <Sider className="site-layout-background" width={200}>
            <Menu
              mode="inline"
              defaultSelectedKeys={['1']}
              defaultOpenKeys={['sub1']}
              style={{ height: '100%' }}
            >
              <SubMenu key="sub1" icon={<UserOutlined />} title="subnav 1">
                <Menu.Item key="1">option1</Menu.Item>
